import React, { Fragment } from "react";

const Auth = () => {
  return (
    <Fragment>
      <div>
        <section>
          <h1>Prijava Korisnika</h1>
          <div>
            <label className="email">Vaš email</label>
            <input></input>
            <label className="password">Vaša lozinka</label>
            <input></input>
          </div>
        </section>
      </div>
    </Fragment>
  );
};

export default Auth;
